class Solution:
	def find132pattern(self, nums):
		"""
		给定一个整数序列：a1, a2, ..., an，一个132模式的子序列 ai, aj, ak
		被定义为：当 i < j < k 时，ai < ak < aj。设计一个算法，当给定有 n 个数字的序列时，验证这个序列中是否含有132模式的子序列。
		注意：n 的值小于15000。
		---
		输入: [1, 2, 3, 4]
		输出: False
		解释: 序列中不存在132模式的子序列。
		---
		思路：
		穷举法
		:type nums: List[int]
		:rtype: bool
		"""
		self.all_three_list = []
		self.find_list([],nums,3)
		for item in self.all_three_list:
			if self.jup123(item):
				print(item)
				return True
		return False

	def find_list(self, param, nums,n):
		if n == 0:
			return self.all_three_list.append(param)
		for i in range(len(nums)):
			self.find_list(param+[nums[i]],nums[i+1:],n-1)

	def jup123(self, item):
		if item[0]<item[2]<item[1]:
			return True
		else:
			return False

	def find132pattern1(self, nums):
		n = len(nums)
		print(n)
		min_list = [0]*n
		min_list[0] = nums[0]
		for i in range(1,n):
			min_list[i] = min(nums[i],min_list[i-1])
		print(min_list)
		for j in range(1,n):
			for k in range(j,n):
				if min_list[j-1] < nums[j] and min_list[j-1] < nums[k] and nums[j] > nums[k]:
					print(j,k)
					return True
		return False

